INSERT INTO `lc_workplan` VALUES (2027, 21, 1538323200, 1, '物料标准化工作：\n1、对比现有物料，完成U8系统物料归类、编码的创建、及关键物料属性的维护（名称、规格型号、成本、存货属性及采购属性）。10月20日完成\n2、明确产品范例推广：完成HGM6110N产品物料编码的创建，并完成相关属性维护，作为单独范例推广试运行。10月25日完成\n3、物料状态梳理：梳理规范现有U8物料，禁用、剔除长期未采购和无上层引用物料。11月11日完成', '2018-11-11', 130, 1, '', '', 130, 1539077724);
INSERT INTO `lc_workplan` VALUES (2028, 21, 1538323200, 2, '新产品导入：\n1、研发新产品图纸审核。完成研发前期设计阶段新产品图纸审核，重点把控可制造性问题，优化生产制程。目前已完成BAC150CAN、HGM6100LT、NC200C、AESYLITE200、HEM4000图纸审核，输出评审问题汇总表。\n2、协调产线焊接研发样板，验证可制造性，\n3、波峰焊设计工艺要求论证。', '2018-12-31', 130, 3, '', '', 130, 1539082872);
INSERT INTO `lc_workplan` VALUES (2029, 21, 1538323200, 3, '生产问题改善：\n1、HGM400N机械手空焊问题改善（已完成）；\n2、元件封装改善：在SPEED MODULE板子上优化改善，样板已提供车间，待排产验证；后续和研发制定标准封装库；\n3、手工工序焊接不良改善（优化PCB走线、敷铜），提供有效整改措施。在NC200C升级版优化敷铜验证完成，改网格效果明显。（已完成）后期用波峰焊接可彻底解决该类问题。', '2018-12-29', 130, 2, '', '', 130, 1539083334);
INSERT INTO `lc_workplan` VALUES (2030, 21, 1538323200, 4, 'U8日常维护（常态化）\n1、新物料、BOM创建：依据各部门需求增加新物料、新产品编码、型号；规范型号、名称、规格书。\n2、变更需求维护：依据变更需求，完成U8系统相关明细及物料变更；\n3、量产BOM位置号维护；\n4、U8日常维护操作规范梳理。', '2018-12-31', 131, 3, '', '', 130, 1539084633);
