INSERT INTO `lc_workplan` VALUES (2169, 15, 1541001600, 11, '本月维修完成目标是70%\n针对加急件优先的原则进行维修，对于加急件要求维修时长不差过一天。另外对于大批量返修件的话，在没有加急件的时候，进行维修，并且要注意大批返修件是否存在共性问题，如果有要及时和质量部进行沟通验证。对于维修中拆掉的坏的元器件进行保存并注明型号和客户名称，交给质量部检验处理，原则上坏的元器件在返修岗位保存时间1个月，剩余的坏器件一个月以后直接进行报废处理，还有对返修产品烧坏严重的拍照保存', '月底前', 90, 1, '', '（5月份完成率52%，6月份完成率56%，7月份完成率70%，8月维修完成率57%，9月份维修完成率66%，10月份维修完成率68%）', 25, 1541576056);
INSERT INTO `lc_workplan` VALUES (2170, 15, 1541001600, 12, '张永飞；主要负责加试入库产品的相关工作。同时要对加急返修品协同处理，要做到加急件不过夜的原则。（加快未完成加试入库的产品加试入库工作进度)。', '月底前', 89, 1, '', '', 25, 1541576109);
INSERT INTO `lc_workplan` VALUES (2173, 15, 1541001600, 14, '新增返修品的追回工作。因为质量原因导致产品故障，临时发客户更换的产品。', '月底前', 89, 3, '', '', 25, 1541576247);
INSERT INTO `lc_workplan` VALUES (2171, 15, 1541001600, 13, '王伟丽，主要负责返修品的收发货和登记入账及整理返修库存的相关工作。10月份的盘库整理工作已经做到台账数量和库存数量的数据已经准确，但是送往电子车间批量加试入库的产品还有252台，将存放在电子车间控制器型号及数量进行统计到账，督促协助车间尽快完成加试。10月份加试入库的产品较多，因此还要加强库存账目管理，制定展品库管理细则。继续保持库存工作的零误差。维修台账报表要做到数据一致，杜绝数据有误的情况。一如既往的秉承有据可证、有物可寻、有数可查的最终零误差的标准来要求自己。同时要做好收到返修品后及时入返修台账和及时清理返修品包装箱的处理工作，养成以5S为标准的工作习惯。从11月份增加了返修临时借货制单和展会借货制单工作', '月底前', 89, 1, '', '。（10月份库存台账数量528台，加试入库未完成有167台，送往车间加试入库数量252台。）', 25, 1541576145);
