INSERT INTO `lc_workplan` VALUES (2342, 15, 1543593600, 11, ' 负责相关售后服务工作、日常问题反馈汇总与跟踪、返修日常管理协调和安排客服部人员的日常工作与跨部门之间的工作沟通。合理安排加快12月份返修进度和返修库存整理工作，新增返修借货相关部门工作职责，对于返修品借货流程按照公司相关制度严格把控，做到有借有还的工作成果。', '20181231', 89, 0, '', '', 25, 1544405907);
INSERT INTO `lc_workplan` VALUES (2343, 15, 1543593600, 12, '  本月主要负责返修品的维修相关工作， 12月份的维修完成率目标是70%，还是要针对加急件优先的原则进行维修，对于加急件要求维修时长不差过一天。另外对于大批量返修件的话，在没有加急件的时候，进行维修，并且要注意大批返修件是否存在共性问题，如果有要及时和质量部进行沟通验证。对于维修中拆掉的坏的元器件进行保存并注明型号和客户名称，交给质量部检验处理，原则上坏的元器件在返修岗位保存时间1个月，剩余的坏器件一个月以后直接进行报废处理，还有对返修产品烧坏严重的拍照保存', '20181231', 90, 0, '', '。（5月份完成率52%，6月份完成率56%，7月份完成率70%，8月维修完成率57%，9月份维修完成率66%，10月份维修完成率68%,11月份维修完成率71%）', 25, 1544405923);
INSERT INTO `lc_workplan` VALUES (2344, 15, 1543593600, 13, '  张永飞：主要负责加试入库产品的相关工作。着重将展会借出的控制器及时加试入展品库。同时要对加急返修品协同处理，要做到加急件不过夜的原则。（加快未完成加试入库的产品加试入库工作进度)。', '20181231', 89, 0, '', '', 25, 1544405968);
INSERT INTO `lc_workplan` VALUES (2345, 15, 1543593600, 14, '王伟丽：主要负责返修品的收发货和登记入账及整理返修库存的相关工作。10～11月份的盘库整理工作已经做到台账数量和库存数量的数据已经准确，但是送往电子车间批量加试入库的产品还有240台，将存放在电子车间控制器型号及数量进行统计到账，督促协助车间尽快完成加试。11月份加试入库的产品较多，因此还要加强库存账目管理，制定展品库管理细则。继续保持库存工作的零误差。维修台账报表要做到数据一致，杜绝数据有误的情况。一如既往的秉承有据可证、有物可寻、有数可查的最终零误差的标准来要求自己。同时要做好收到返修品后及时入返修台账和及时清理返修品包装箱的处理工作，养成以5S为标准的工作习惯。从11月份增加了返修临时借货制单和展会借货制单工作，负责借货审核和登记工作，对还未及时还入（2个月之内）的客户进行催货', '20181231', 89, 0, '', '。（11月份库存台账数量428台，加试入库未完成有167台，送往车间加试入库数量240台。借出返修货物合计数量：34；已还数量：14；未还数量 ：20）', 25, 1544406025);
